                WriteLiteral(@"          <div class=""col span-2of-2"">
                <h2 class=""heading-page heading-about"">
                    About
                </h2>
                <hr class=""hr-about"">
                <h4>Oscar Peterson</h4>
                <p>A select member of jazz’s piano pantheon, Fred Hersch is a pervasively influential creative force who has shaped the music’s course over more than three decades as an improviser, composer, educator, bandleader, collaborator and recording artist. He has been proclaimed “the most arrestingly innovative pianist in jazz over the last decade” by <em>Vanity Fair</em>, “an elegant force of musical invention” by <em>The L.A. Times</em>, and “a living legend” by<em>The New Yorker</em>.</p>
                <p>A fifteen-time Grammy nominee, Hersch has regularly garnered jazz’s most prestigious awards, including recent distinctions as a 2016 Doris Duke Artist, 2016 and 2018 Jazz Pianist of the Year from the Jazz Journalists Association, and the 2017 Prix Honorem de Jazz from L’A");
                WriteLiteral(@"cádemie Charles Cros for the totality of his career.</p>
                <p>If good things happen slowly, as the title of Hersch’s 2017 memoir attests, such good fortune has nonetheless accrued to the point where the pianist can enjoy the accolades and adulation of peers, critics and audiences alike. He has long set the standard for expressive interpretation and inventive creativity in a stunning variety of settings, whether through his exquisite solo performances, as the leader of one of jazz’s era-defining trios, or in eloquent dialogue with his deeply attuned duo partners.</p>
                <p>With more than three-dozen albums to his credit as a leader or co-leader, Hersch consistently receives lavish critical praise and numerous international awards for each highly anticipated new release. His latest album with his long-standing trio, 2018’s <em>Live In Europe</em>(Palmetto), documents one remarkable evening in Brussels and has been hailed as its best to date – considerable praise for an ensemble that");
                WriteLiteral(@" consistently plays at such a staggeringly high level.</p>
                <p>The trio, in which Hersch has been joined by bassist John Hébert and drummer Eric McPherson for the last decade, was voted the #2 Jazz Group in the 2018 <em>DownBeat </em>Critics Poll, recognizing its unique ability to traverse a wide range of styles and approaches while maintaining profound depths of emotion and the exhilarating spark of invention. Its previous two Palmetto releases, 2016’s <em>Sunday Night at the Vanguard</em>and 2014’s <em>Floating, </em>were both nominated for Grammy Awards in the categories of Best Jazz Solo and Best Jazz Album.</p>
